    false,nt"url": null,nt"notes": "The Light Detection and Ranging (LiDAR)
    dataset is a survey of the Jean Lafitte,G13PD00214, 1.0 Meter LiDAR Survey Area
    in south of New Orleans and encompasses 77 square miles. The LiDAR point cloud was
    flown at a nominal post spacing of 1.0 meters for unobscured areas. The LiDAR data
    and derivative products produced are in compliance with the U.S. Geological Survey
    National Geospatial Program Guidelines and Base Specifications, Version 1. The flight
    lines were acquired by Digital Aerial Solutions, LLC. on March, 05, 2013. Derivative
    products from the aerial acquisition include: Raw point cloud data in LAS v1.2,
    classified point cloud data in LAS v1.2, bare earth surface tiles (raster DEM LZW
    compressed 32-bit geotiff format), control points, project report, and FGDC compliant
    XML metadata.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
